/**
 * @param {number} purchaseAmount
 * @return {number}
 */
var accountBalanceAfterPurchase = function(purchaseAmount) {
    // Calculate remainder
    var remainder = purchaseAmount % 10;

    // Round up if remainder is 5 or more, otherwise round down
    var roundedAmount = remainder >= 5 ? purchaseAmount + (10 - remainder) : purchaseAmount - remainder;

    // Subtract the rounded amount from the initial balance
    return 100 - roundedAmount;
};
